<blockquote><div>News</div></blockquote>
In advance, director Simon McQuoid has talked a lot about wanting to be true to the violent roots of the "Mortal Kombat" games as much as possible with the new film, which I can safely say that they have succeeded with.Â <a>https://fastandfurious9denmark.wildapricot.org/film/10544581</a>

Already three minutes into the film, the blood begins to splash and after two hours, body parts have had time to fly in all directions, the head has been pointed and the intestines have been exposed. Whether it succeeds on other fronts is a completely different matter.Â <a>https://blockhelden.de/community/profile/fastandfuriousgerman/</a>

Just like in the games, the premise is that humanity must take part in a battle tournament against the evil kingdom Outworld, in order to prevent Emperor Shang Tsung from conquering the earth. However, a prophecy says that a group of fighters will unite and defeat the darkness.Â  <a>https://treasurechest.com.ua/community/profile/fastandfurious9/</a>

Here we meet the mediocre MMA fighter and brand new character Cole Young (Lewis Tan), who is suddenly chased by the emperor's icy right hand Sub-Zero. Cole has a birthmark on his chest that resembles a dragon's head, like a legendary warrior who fought in tournaments hundreds of years ago.Â <a>https://treasurechest.com.ua/community/profile/wrathofman/</a>

After escaping the cold villain, he meets other fighters from the games such as Sonya Blade (Jessica McNamee), Jax (Mehcad Brooks) and Kano (Josh Lawson) with the same mark on their body, which turns out to be a sign that they are selected to fight for the fate of the earth.Â <a>https://www.verticalvic.fr/community/profile/fastandfurious9france/</a>

