<a class="style-scope ytcp-video-info" href="https://youtu.be/EnXzBcoj0r8" target="_blank" rel="noopener nofollow">https://youtu.be/EnXzBcoj0r8</a>

Leech your opponents life by sucking out their cards and LP with this Castlevania themed deck

&nbsp;

Very flavorful

&nbsp;

&nbsp;

<span>Using many combos and other things to exploit people's greed for card advantage while gaining life points so you can survive while they deck out. For example you play graceful tear and give them pot of desires. By removing their deck because people care about card advantage so much, they don't realize they are getting played. It also uses kaijus as defense.</span>

